  var header = $('.fsc-developerHeader');
  var productLink = $('.fsc-developerHeader-productToggle');
  var otherLinks = $('.fsc-developerHeader-navLink');
  var darkLogo = $('.fsc-developerHeader-logo > .dark');
  var lightLogo = $('.fsc-developerHeader-logo > .light');
  var mobileToggle = $('.fsc-developerHeader-menuToggleText');

  function setToDarkHeader() {
    header.addClass('darkTheme slim');
    productLink.addClass('darkTheme');
    otherLinks.addClass('darkTheme');
    lightLogo.addClass('darkTheme');
    darkLogo.addClass('darkTheme');
    mobileToggle.addClass('darkTheme');
  }

  function setToLightHeader() {
    header.removeClass('darkTheme slim');
    productLink.removeClass('darkTheme');
    otherLinks.removeClass('darkTheme');
    lightLogo.removeClass('darkTheme');
    darkLogo.removeClass('darkTheme');
    mobileToggle.removeClass('darkTheme');
  }

  // $(window).scroll(function() {
